import React from "react";

function Project(props) {
    return (
        <section>
            {props.projects.map(item => {
                if(item.hasApp === true)
                {
                    <div key={item.id}>
                        <h3>{item.name}</h3>
                        <img src={item.photoLink}/>
                        <p>{item.description}</p>
                        
                    </div>
                }else{

                }
            })}
        </section>
    )
}

export default Project;
